const Btask = () => {
    const TaskData = [
        {
            sNo: 1,
            batch: "A1",
            task: "frontend",
            submissionDate: new Date()
        },
        {
            sNo: 2,
            batch: "A1",
            task: "frontend",
            submissionDate: new Date()
        }
    ];

    return (
     console.log(TaskData)
    );
};

export default Btask;
